		function shuffle(arry) //פונקציה לערבוב ערכי המערך
		{
			for (currentIndex = 0; currentIndex < arry.length; currentIndex++) {
				var randIndex = Math.floor(Math.random() * arry.length);
				swap(arry, currentIndex, randIndex);
			}
		}
		
		function swap(arry, first, second) //החלפה במערך את האיברים בשני האינדקסים המתקבלים
		{
			var temp = arry[first];
			arry[first] = arry[second];
			arry[second] = temp;
		}
		
		function large(evt) {
			var bigger = evt.currentTarget; //יצירת אינסטנס חדש של התמונה
			bigger.scaleX = 2; //פי כמה להגדיל
			bigger.scaleY = 2;
		}
		//פונקציה להחזרת התמונה לגודלה המקורי
		function small(evt) {
			var small = evt.currentTarget; //יצירת אינסטנס חדש של התמונה
			small.scaleX = 1; //פי כמה להגדיל
			small.scaleY = 1;
		}
		
		function overopt(evt) { //פונקציה למעבר עכבר
			var strok = new lib.optStrok();
			strok.name = "mystrok";
		
			for (i = 0; i < myGame[rnd][1].length; i++) {
				stage.removeChild(stage.getChildByName("mystrok"));
			}
			// מיקום והוספה של המסגרת הצהובה
			strok.x = evt.currentTarget.x;
			strok.y = evt.currentTarget.y;
			stage.addChild(strok);
		} // סגירת הפונקציה
		
		//פונקציה ליציאה ממעבר עכבר
		//החזרת כל המסיחים למצב דיפולטיבי
		function mouseoutopt(evt) {
			for (i = 1; i < myGame[rnd].length; i++) { //הגדרת כל המסיחים למצב דיפולטיבי
				stage.getChildByName("option" + i).alpha = 1;
				stage.removeChild(stage.getChildByName("mystrok"));
			}
		} // סגירת הפונקציה
		
